var tipuesearch = {"pages":[{"title":"41123220 w6","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 第六週作業 本週任務: 1.ODOO PLM 論文中英並列任務(期中作業) 2.教學影片分組整理並自評 上週追蹤事項 1.教學影片分組整理並自評 在影片上填上字幕, 另行上傳到可以嵌入到各分組的網站上 從影片字幕中整理出逐字稿, 放在影片下方, 以 .txt 連結安排 *並在各嵌入的教學影片下方, 以摘要方式說明該影片的教學重點 2.利用 NX1872 協同繪製零組件 3.統整組員子模組中的協同設計網誌 本周和上周的作業是一模一樣的，目前我們這組已完成所有影片的字幕，我所分到的是影片1及2的字幕，以下是成果。 影片1~2上字幕 影片1 字幕稿 影片2 字幕稿","tags":"41123220 w6","url":"./41123220 w6.html"},{"title":"41123220 w5","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 第五週作業 本週任務: 1.教學影片分組整理並自評 在影片上填上字幕, 另行上傳到可以嵌入到各分組的網站上 從影片字幕中整理出逐字稿, 放在影片下方, 以 .txt 連結安排 *並在各嵌入的教學影片下方, 以摘要方式說明該影片的教學重點 2.利用 NX1872 協同繪製零組件 3.統整組員子模組中的協同設計網誌 上週追蹤事項 1.Odoo 參考文章中英並列(期中的作業) 目前我已完成第六章的翻譯以及latex的撰寫 第六章latex程式 第六章.pdf","tags":"41123220 w5","url":"./41123220 w5.html"},{"title":"41123222 w5","text":"2024 Spring 每周網誌心得. w5網誌心得 將教學影片附上字幕且紀錄逐字稿txt檔，而我做的是7~8的影片 123879454564","tags":"41123222 w5","url":"./41123222 w5.html"},{"title":"41123220 w4","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 第四週作業 本週任務: 1.Odoo 參考文章中英並列(期中的作業) 上週追蹤事項 1.將組員的個人倉儲設為分組倉儲子模組 2.期中協同分組報告 分組倉儲的子模組已經弄好了，剩下期中的作業還在分配當中。","tags":"41123220 w4","url":"./41123220 w4.html"},{"title":"41123220 w3","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 第三週作業 本週任務: 1.將組員的個人倉儲設為分組倉儲子模組 2.期中協同分組報告 期中報告是將 2021 ANALYSIS OF THE ODOO SOFTWARE CAPABILITIES REGARDING PRODUCT LIFECYCLE MANAGEMENT, MANUFACTURING EXECUTION SYSTEMS AND THEIR INTEGRATION.pdf 這份論文翻譯並以latex的形式放到組別倉儲上。 上週追蹤事項 1.利用 Github Classroom 指定分組倉儲 2.利用 Codespaces 維護倉儲與網站 3.設定網誌 所有任務均已完成!","tags":"41123220 w3","url":"./41123220 w3.html"},{"title":"41123222 w4","text":"2024 Spring 每周網誌心得. w4網誌心得 今日學習用終端機維護群組bg5倉儲 chmod u+x init_replit ./init_replit\\ 上述兩條指令即可將github導入replit且進行維護 python3 main.py開啟動態 若是維護完則是以 git add. git commit -m\"xxx\" git push即可以完成推 更新網誌則要多增加一條 ./gen_blog","tags":"41123222 w4","url":"./41123222 w4.html"},{"title":"41123203 W3","text":"2024 Spring 每周心得 W3網誌心得 這個禮拜我們將個人倉儲納入分組倉儲，讓我們可以更好統一代碼，方便版本控制和操作。子模組讓我們可以更方便的合作，可以先在自己的個人倉儲中進行，然後再集成到分組倉儲中。透過這次分組活動我覺得我們更有凝聚力!","tags":"w3","url":"./41123203 w3.html"},{"title":"41123220 w2","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 第二週作業 本週任務: 1.利用 Github Classroom 指定分組倉儲 2.利用 Codespaces 維護倉儲與網站 3.設定網誌 我是擔任第5組的組長，所以建立分組倉儲是我的任務，這次建的倉儲和以前不一樣，是從空白開始建的，難度將會大大提升，所幸最後還是順利用出來了!","tags":"41123220 w2","url":"./41123220 w2.html"},{"title":"41123222 w3","text":"2024 Spring 每周網誌心得. w3網誌心得 今天老師講解了gitpod，為了防止終端機的流量用完有補救方案，hw則是用latex來整理格式 latex格式 以下為開頭 %開頭=\\documentclass[10pt,a4paper]{report} %紙張設定 \\usepackage{xeCJK}%中文字體模組 \\usepackage{graphicx}%插入圖片套件 \\usepackage{tocbibind}%自動添加目錄和參考文獻到目錄中套件 \\usepackage{hyperref}%生成超連結模組 \\usepackage[margin=2cm]{geometry} % 在 Windows 可以使用系統所安裝的字型 \\setCJKmainfont{標楷體}%設定中文字體 \\newfontfamily\\sectionef{Times New Roman}%設定英文字體。 以下則是加黑加粗的文法\\兩次則是換行 \\large\\textbf{5.1.3.5 The engineering change order }\\工程變更訂單 這個則是圖片的文法 \\begin{figure}htbp \\centering \\includegraphics[]{../image/5135.png} \\label{fig:5135} \\end{figure} 圖片必須存在資料夾且一定要記住image的名稱 最後結束時打上\\end{document} 這樣latex格式hw就大致完成剩餘翻譯用chatgpt來做。 新增子模組至bg5 打上 git submodules add 自己github網址.git 41123222 就能新增至群組。","tags":"41123222 w3","url":"./41123222 w3.html"},{"title":"41123203 W2","text":"2024 Spring 每周心得 W2網誌心得 使用 GitHub Codespaces 維護個人和分組網站帶來了許多好處。不僅簡化了開發流程，還提高了團隊合作效率，也減少了許多環境配置的麻煩。我學到了如何在雲端開發環境中進行有效的協作，並且意識到了這對於提高生產力和代碼質量的重要性。也上了一堂很有挑戰但過程很有趣的課。","tags":"w2","url":"./41123203 w2.html"},{"title":"41123222 w2","text":"2024 Spring 每周網誌心得. w2網誌心得 在第二周用Github Classroom加入分組倉儲，且選出了組長 用codespace 維護群組倉儲網站，這也是第一次寫網誌","tags":"41123222 w2","url":"./41123222 w2.html"},{"title":"2024 Spring 課程","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 內容管理系統 使用者可以自行利用 cmsimde_site 倉儲作為 Template, 建立自己的網站內容管理系統. 引用網站網址連結的方法: cmsimde_site - 在文章中多次引用同一個網站連結時, 可以使用此種方法. https://github.com/mdecycu/cmsimde_site - 假如想要快速將網址套用 html 網站連結, 可以使用此種方法. cmsimde_site - 也可以使用 Markdown 的標準網站連結使用格式. # 引用 Python 程式的方法 for i in range(10): print(i, \"列出字串\") 也可以直接在 .md 檔案中使用 html 標註, 或加入 Javascript 或 Brython 程式碼. 從 1 累加到 100: 1 add to 100 將 iterable 與 iterator 相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. Filename: .py Run Output 清除輸出區 清除繪圖區 Reload 從 1 累加到 100 part2: 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block Filename: .py Run Output 清除輸出區 清除繪圖區 Reload","tags":"w1","url":"./2024-Spring-w1-blog-tutorial.html"},{"title":"41123203 W1","text":"2024 Spring 每周心得 內容管理系統 使用者可以自行利用 cmsimde_site 倉儲作為 Template, 建立自己的網站內容管理系統. 引用網站網址連結的方法: cmsimde_site - 在文章中多次引用同一個網站連結時, 可以使用此種方法. https://github.com/mdecycu/cmsimde_site - 假如想要快速將網址套用 html 網站連結, 可以使用此種方法. cmsimde_site - 也可以使用 Markdown 的標準網站連結使用格式. # 引用 Python 程式的方法 for i in range(10): print(i, \"列出字串\") 也可以直接在 .md 檔案中使用 html 標註, 或加入 Javascript 或 Brython 程式碼. 從 1 累加到 100: 1 add to 100 將 iterable 與 iterator 相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. Filename: .py Run Output 清除輸出區 清除繪圖區 Reload 從 1 累加到 100 part2: 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block Filename: .py Run Output 清除輸出區 清除繪圖區 Reload","tags":"w1","url":"./41123203 w1.html"},{"title":"41123222 w1","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 內容管理系統 使用者可以自行利用 cmsimde_site 倉儲作為 Template, 建立自己的網站內容管理系統. 引用網站網址連結的方法: cmsimde_site - 在文章中多次引用同一個網站連結時, 可以使用此種方法. https://github.com/mdecycu/cmsimde_site - 假如想要快速將網址套用 html 網站連結, 可以使用此種方法. cmsimde_site - 也可以使用 Markdown 的標準網站連結使用格式. # 引用 Python 程式的方法 for i in range(10): print(i, \"列出字串\") 也可以直接在 .md 檔案中使用 html 標註, 或加入 Javascript 或 Brython 程式碼. 從 1 累加到 100: 1 add to 100 將 iterable 與 iterator 相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. Filename: .py Run Output 清除輸出區 清除繪圖區 Reload 從 1 累加到 100 part2: 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block Filename: .py Run Output 清除輸出區 清除繪圖區 Reload","tags":"41123222 w1","url":"./41123222 w1.html"}]};